webpackJsonp([46883942568238],{3875:function(n,t){n.exports={data:{markdownRemark:{html:'<p>個人的備忘録も兼ねて、<a href="http://karen.saiin.net/%7Ekouroumu-toho/">紅楼夢</a>までの予定。</p>\n<ul>\n<li>15:50 家出発</li>\n<li>16:10 電車乗る(特急→池袋→地下鉄)</li>\n<li>17:50 新幹線のぞみ31号乗る</li>\n<li>\n<p>19:33 名古屋で下車\n翌日始発で新大阪迄行く感じで。</p>\n<h2>(16:50追記) 電車乗り遅れたorz</h2>\n<p>この調子だと、最速池袋から丸の内線で東京に17:47着。グリーン席予約してある500系のぞみ31号が17:50発。死亡フラグ。</p>\n<h2>(18:50追記) 忘れ物</h2>\n<p>新幹線の中で気付いたが、ノートPC持参したはいいがACアダプタ忘れた……orz 残り少ないバッテリー残量、何に使おうか……</p>\n</li>\n</ul>',frontmatter:{cover:null,date:"2005-09-10T02:57:00+09:00",strDate:"2005/9/9",title:"紅楼夢ｲﾃｷﾏｰ"}}},pathContext:{path:"/ja/blog/2005/09/10-紅楼夢イテキマー/",langKey:"ja"}}}});
